import React, { useState } from 'react';
import styled from 'styled-components';
import {useLocation, useNavigate } from 'react-router-dom';
import {getAuth, OAuthProvider , signInWithPopup} from 'firebase/auth';
import auth from '../../firebase'; // 경로를 수정

const SignUpPage = () => {
  const [email, setEmail] = useState('');
  const [authNumber, setAuthNumber] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [phone, setPhone] = useState('');
  const [nickname, setNickname] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // 회원가입 처리 로직 추가
    console.log('이메일:', email);
    console.log('인증 번호:', authNumber);
    console.log('비밀번호:', password);
    console.log('비밀번호 확인:', confirmPassword);
    console.log('휴대폰 번호:', phone);
    console.log('닉네임:', nickname);
  };


  const handleKakaoLogin = async () => {
    const provider = new OAuthProvider('kakao.com');

    try {
      const result = await signInWithPopup(auth, provider);
      const user = result.user;
      console.log('로그인 성공:', user);
    } catch (error) {
      console.error('로그인 실패:', error);
    }
  };




  return (
    <Container>
    <Logo>
   <img
       alt=" Logo"
       src="/images/logo1.png"
     onClick={() => (window.location.href = "/")}/>
   </Logo>

 <Con1>
   <Form onSubmit={handleSubmit}>


     <Label>이 메 일</Label>
     <Input 
       type="email" 
       value={email} 
       onChange={(e) => setEmail(e.target.value)} 
       placeholder="이메일 입력" 
       required 
     />


     <Label>인 증 번 호</Label>
     <Input 
       type="text" 
       value={authNumber} 
       onChange={(e) => setAuthNumber(e.target.value)} 
       placeholder="인증번호 입력" 
       required 
     />
     <Label>비밀번호</Label>
     <Input 
       type="password" 
       value={password} 
       onChange={(e) => setPassword(e.target.value)} 
       placeholder="비밀번호 입력" 
       required 
     />
     <Label>비밀번호 확인</Label>
     <Input 
       type="password" 
       value={confirmPassword} 
       onChange={(e) => setConfirmPassword(e.target.value)} 
       placeholder="비밀번호를 다시 입력해주세요." 
       required 
     />
     <Label>휴 대 폰 번 호</Label>
     <Input 
       type="tel" 
       value={phone} 
       onChange={(e) => setPhone(e.target.value)} 
       placeholder="휴대폰 번호 입력" 
       required 
     />
     <Label>닉 네 임</Label>
     <Input 
       type="text" 
       value={nickname} 
       onChange={(e) => setNickname(e.target.value)} 
       placeholder="닉네임 입력" 
       required 
     />
     <Button type="submit">가입하기</Button>

     </Form>

     </Con1>



     <Form>
     <SocialLoginContainer>
     <SocialButton1 yellow>
         <Icon src="/images/pngwing.com.png" alt="카카오톡 아이콘" /> 카카오로 시작하기
       </SocialButton1>
       <SocialButton2 >
         <Icon src="/images/네이버 로고 아이콘.png" alt="네이버 아이콘" /> 네이버로 시작하기
       </SocialButton2>
     </SocialLoginContainer>
   </Form>
 </Container>
);
};

export default SignUpPage;

// Styled Components
const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
`;

const Logo = styled.div`
  position: absolute;
  top:1.5%;

  img {
    width: 90%; /* 부모 요소의 너비에 맞게 조정 */
    max-width: 300px; /* 최대 너비 설정 */
    height: auto; /* 비율 유지 */
    cursor: pointer;
  }
`;

const Form = styled.form`
  display: flex;
  flex-direction: column;
//  align-items:center;
//  justify-content: center;
  width: 25%;
`;

const Con1 = styled.form`
  display: flex;
  flex-direction: column;
  border: 2px solid;
  // border-color: rgba(160, 218, 251, 0.5);
  border-color: #A0DAFB;
  border-radius: 30px 30px 1px 30px;
  width: 90%;
  padding: 20px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);

`;

const Label = styled.label`
  margin: 10px 0 5px;
  font-size: 35px;
  font-weight: bold;
  margin-bottom:10px;
  color: rgba(160, 218, 251);
`;

const Input = styled.input`
  padding: 16px;
  border: 2px solid #0080ff; //진한 파랑
  border-radius:15px;
  border-color: #A0DAFB;
  margin-bottom: 10px;



`;

const HelperText = styled.span`
  font-size: 12px;
  color: #888;
  margin-bottom: 10px;
`;

const CheckboxContainer = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 15px;
`;

const Checkbox = styled.input`
  margin-right: 5px;

`;

const CheckboxLabel = styled.label`
  font-size: 14px;
`;

const Button = styled.button`
  padding: 10px;
  background-color: #3563E9 ;
  color: white;
  border: none;
  cursor: pointer;
  margin-bottom: 10px;
  font-size:14px;
  font-weight: bold;
  padding:14px;
  // border-radius: 10px;
  border-radius: 30px 30px 1px 30px;


  &:hover {
    color: #aaa;

`;

const SocialLoginContainer = styled.div`
  display: flex;
  flex-direction: column;
  margin-top:40px;
`;

const SocialButton1 = styled.button`
  padding: 10px;
  background-color: ${props => (props.yellow ? '#f7e02e' : '#3dbd4e')};
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  margin-top: 5px;
  font-size:14px;
  color: black;
  font-weight: bold;
  padding:10px;
  border-radius: 30px 30px 1px 30px;


  &:hover {
    color: #aaa;
`;


const SocialButton2 = styled.button`
  padding: 10px;
  background-color: #03CF5D; /* 네이버 색상 */
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  margin-top: 5px;
  font-size:14px;
  color: white;
  font-weight: bold;
  padding:10px;
  // border-radius: 10px;
  border-radius: 30px 30px 1px 30px;


  &:hover {
    color: #aaa;
`;

const Icon = styled.img`
  width: 25px; /* 아이콘 크기 조절 */
  height: 25px;
  margin-right: 5px;
  vertical-align: middle;

`;


const Signup = styled.span`
  font-size: 14px;
  color: #888;
  margin-top: 20px;

  span {
   color: #0080ff;
   cursor: pointer;
   font-weight: bold;


   &:hover {
    color: #62B9EC;
  }

`;
